});

$('#ambilCase').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputCasing />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilRAM').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputRAM />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilPSU').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputPSU />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#loginDong').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <Login />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});


$('#kuyRakit').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <RakitPC />
      </div>
    </React.StrictMode>,
    document.getElementById('rakit')
  );
});

$('#lowTier').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <LowTier />
      </div>
    </React.StrictMode>,
    document.getElementById('root2')
  );
});

